CREATE TABLE CursoEstudiante(
CursoEstudianteId INT NOT NULL IDENTITY(1,1), 
CursoId int NOT NULL,
EstudianteId int NOT NULL,
FechaMatricula datetime NOT NULL,
EstadoEvaluacionCursoyDocente TINYINT NOT NULL,
AprobacionCurso TINYINT NOT NULL,
Estado TINYINT NOT NULL,
PRIMARY KEY (CursoEstudianteId),
FOREIGN KEY (CursoId) REFERENCES Cursos (CursoId),
FOREIGN KEY (EstudianteId) REFERENCES Personas (PersonaId)
);
DBCC CHECKIDENT (CursoEstudiante, RESEED,1); -- obliga a que el contador de llave primaria empiece en 1
 
 
CREATE TABLE MaterialDidactico(
MaterialDidacticoId INT NOT NULL IDENTITY(1,1), 
CursoId INT NOT NULL, 
DocenteId INT NOT NULL,  
Contenido  varbinary(max),
Filename VARCHAR(220) DEFAULT NULL,
Mensaje VARCHAR(max) DEFAULT NULL,
ContentType VARCHAR(120) DEFAULT NULL,
Version INT NOT NULL, 
FechaRegistro DATETIME NOT null,
Estado TINYINT NOT NULL, 
PRIMARY KEY (MaterialDidacticoId), 
FOREIGN KEY (CursoId) REFERENCES Cursos (CursoId),
FOREIGN KEY (DocenteId) REFERENCES Personas (PersonaId)
);
DBCC CHECKIDENT (MaterialDidactico, RESEED,1); -- obliga a que el contador de llave primaria empiece en 1 

CREATE TABLE ForoTema(
ForoTemaId INT NOT NULL IDENTITY(1,1), 
CursoId INT NOT NULL, 
DocenteId INT NOT NULL,
Tema VARCHAR(120) DEFAULT NULL,
Descripcion VARCHAR(255) DEFAULT NULL,
FechaRegistro DATETIME NOT null,
Estado TINYINT NOT NULL,  
PRIMARY KEY (ForoTemaId), 
FOREIGN KEY (CursoId) REFERENCES Cursos (CursoId),
FOREIGN KEY (DocenteId) REFERENCES Personas (PersonaId)
);
DBCC CHECKIDENT (ForoTema, RESEED,1); -- obliga a que el contador de llave primaria empiece en 1 
 
CREATE TABLE ParticipacionEnForoTema(
ParticipacionEnForoTemaId INT NOT NULL IDENTITY(1,1), 
ParticipanteId INT NOT NULL, 
ForoTemaId INT NOT NULL,  
Mensaje VARCHAR(MAX),
FechaRegistro DATETIME NOT null 
PRIMARY KEY (ParticipacionEnForoTemaId), 
FOREIGN KEY (ForoTemaId) REFERENCES ForoTema (ForoTemaId),
FOREIGN KEY (ParticipanteId) REFERENCES Personas (PersonaId)
);
DBCC CHECKIDENT (ParticipacionEnForoTema, RESEED,1); -- obliga a que el contador de llave primaria empiece en 1 

CREATE TABLE SistemaCorreo(
SistemaCorreoId INT NOT NULL IDENTITY(1,1), 
RemitenteId INT NOT NULL, 
DestinoId INT NOT NULL, -- [Destinatario principal, uno por uno de la lista de todos]
Asunto VARCHAR(170),
Mensaje VARCHAR(MAX),
FechaEnvio DATETIME NOT null,
EstadoLectura TINYINT NOT NULL, 
FechaLectura DATETIME, 
PRIMARY KEY (SistemaCorreoId), 
FOREIGN KEY (RemitenteId) REFERENCES Personas (PersonaId),
FOREIGN KEY (DestinoId) REFERENCES Personas (PersonaId) 
);
